(function()
{
    "use strict";

    var _options = {
            title: '提示信息',
            content: '',

            contentClass: 'popup-dialog',

            width: undefined,
            height: undefined,

            submitText: '确定',
            cancelText: '取消',

            window: window,// top,
            appendTo: window.document.body, // top.document.body,

            operation: false,
            overlay: true,
            cancelButton: false,
            submitButton: true,

            // 旧模版
            templates: {
                layout: '<div class="popup-layer">{{overlay}}<div class="popup-scrim"><a class="popup-close"></a><div class="popup-inner"><div class="popup-title">{{title}}</div><div class="popup-wrapper"><div class="popup-container">{{content}}</div>{{operation}}</div></div></div></div>',
                operation: '<div class="popup-operation"><div class="operation-btns">{{submitButton}} {{cancelButton}}</div></div>',
                overlay: '<div class="popup-overlay"></div>',
                cancelButton: '<input type="button" role="cancel" value="{{cancelText}}">',
                submitButton: '<input type="button" role="submit" value="{{submitText}}">'
            },
            
            selectors: {
                'close': 'a.popup-close',
                'cancel': 'input[role=cancel]',
                'submit': 'input[role=submit]',
                'header': '.popup-title',
                'container': '.popup-scrim'
            }

            // templates: {
            // layout: '<div class="mask show"> <div class="mask-inner"> <div
			// class="lightbox"> <header> <h4>{{title}}</h4><a class="close
			// light-box-close"><i class="icon-close"></i></a> </header> <div
			// class="body">{{content}}</div>{{operation}} </div> </div>
			// </div>',
            // operation: '<div class="footer">{{submitButton}}
			// {{cancelButton}}</div>',
            // overlay: '<div class="popup-overlay"></div>',
            // cancelButton: '<a class="btn btn-red fl
			// cancel">{{cancelText}}</a>',
            // submitButton: '<a class="btn btn-green fr
			// submit">{{submitText}}</a>'
            // },

            // selectors: {
            // 'close': 'a.close',
            // 'cancel': 'a.cancel',
            // 'submit': 'a.submit',
            // 'header': 'header',
            // 'container': '.lightbox'
            // }
        };

    function Dialog(options)
    {
        this.init(options);
    };

    window.Dialog = Dialog;

    Dialog.setOptions = function(options)
    {
        $.extend(true, _options, options || {});
    };

    Dialog.fn = Dialog.prototype = {
        constructor: Dialog,

        $element: null,

        init: function(options)
        {
            this.options = $.extend(true, {}, _options);
            this.options = $.extend(true, this.options, options);

            this.append();
            
            return this;
        },

        _prepareTemplate: function()
        {
            var _templates = this.options.templates,
                template = _templates.layout;

            template = template
                    .replace('{{overlay}}', this.options.overlay ? _templates.overlay : '')
                    .replace('{{operation}}', this.options.operation ? _templates.operation : '')
                    .replace('{{cancelButton}}', this.options.cancelButton ? _templates.cancelButton : '')
                    .replace('{{submitButton}}', this.options.submitButton ? _templates.submitButton : '')
                    .replace('{{submitText}}', this.options.submitText || '确定')
                    .replace('{{cancelText}}', this.options.cancelText || '取消')
                    .replace('{{title}}', this.title())
                    .replace('{{content}}', this.content());

            this.$element = $(template);
        },

        _bindEvents: function()
        {
            var self = this,
                submit = this.$element.find(this.options.selectors.submit),
                cancel = this.$element.find(this.options.selectors.cancel);
            
            if($().draggable)
            {
                this.$element.find(this.options.selectors.container)
                        .draggable({handle: this.options.selectors.header, cursor: 'move'});
            }

            this.$element.find(this.options.selectors.close).click(function()
            {
                self.onDestroy();
                self.destroy();
            });

            submit.click(function()
            {
                self.onSubmit();
            });

            cancel.click(function()
            {
                self.onCancel();
            });
        },

        initPosition: function()
        {
            var $wrap = this.$element.find(this.options.selectors.container),
                top = ($(this.options.window).height() - $wrap.height()) / 2;
                top = top < 0 ? 0 : top;

            $wrap.css({
                // left: ($(this.options.window).width() - $wrap.width()) / 2,
                top: top
            });

            return this;
        },

        initSize: function()
        {
            if(this.options.width)
            {
                var $wrap = this.$element.find(this.options.selectors.container);

                $wrap.width(this.options.width);
            }

            if(this.options.height)
            {
                var $wrap = this.$element.find(this.options.selectors.container);

                $wrap.height(this.options.height);
            }

            return this;
        },

        title: function()
        {
            return this.options.title;
        },

        content: function()
        {
            var content = this.options.content;

            if(this.options.contentClass)
            {
                content = '<div class="' + this.options.contentClass + '">' 
                        + content + '</div>';
            }

            return content;
        },

        append: function()
        {
            this._prepareTemplate();

            this.$element.appendTo(this.options.appendTo || 'body');

            this._bindEvents();


            // 旧模版需要控制尺寸和位置
            this.initSize();
            this.initPosition();

            var self = this;
            $(this.options.window).resize(function()
            {
                self.initPosition();
            });
        },

        destroy: function()
        {
            this.$element.remove();
            this.onDestroy();
        },

        onSubmit: function()
        {
            this.destroy();
        },

        onCancel: function()
        {
            this.destroy();
        },

        onDestroy: function()
        {
            
        }
    };
})();

/**
 * 系统常用js函数
 */

/**
 * 
 * 改变某条记录 包括启用 停用 删除等操作 参数说明： type:请求类型 url:请求地址 id:记录id
 * ajax请求成功后回调函数change_end();
 */
var KF5 = {};

KF5.alert=function(content,title){
    var alertTitle=title==undefined?'提示信息':title;
    var alertEl=$('<div class="light-box-mask">\
    <div class="light-box">\
    <header>\
    <a class="close" href="javascript:void(0);" onclick="$(this).parent().parent().parent().remove();"><i class="icon-cross"></i></a>\
    <h3>'+alertTitle+'</h3>\
    </header>\
    <div class="light-box-body light-box-alertbody"><p class="alert">'+content+'</p></div>\
    </div>\
    </div>');
    alertEl.appendTo('body');
};

KF5.loading = '<div class="content_loading"></div>';
KF5.remove_loading = function()
{
	$(".content_loading").remove();
}
KF5.password_strength = function (pwd) {   
    if (pwd.length < 6) return 0;   
    var ls = 0;   
    if (pwd.match(/[a-z]/ig)) ls++;   
    if (pwd.match(/[0-9]/ig)) ls++;   
    if (pwd.match(/(.[^a-z0-9])/ig)) ls++;   
    if (pwd.length < 6 && ls > 0) ls--;   
    return ls;   
};
function desk_change(type,url,id)
{
	$.post(url, {type: type, id: id },
		function(data){
			change_end(type,data);
		}
	);
}


/**
 * 以弹窗的形式显示提交表单时的错误提示信息
 */
function errorSummary(){
	if($('.errorSummary').length > 0){
        var title=$('.errorSummary p').html(),
            content='';
        $('.errorSummary li').each(function(){
            content+=$(this).html()+'<br />';
        });
        KF5.alert(content,title);
	}
}


/**
 * 显示提示信息，通常用于ajax提示 例子：showNotice("请求已处理成功",true);
 */
function showNotice(message,type)
{	
	$(".alert.alert-toptips").remove();
	if(type!=false) type = true;
	var alert_type = type ? "alert-success" : "alert-danger" ;
	$(".panel-wrap").before("<div class='alert alert-toptips "+alert_type+" onclick='$(this).fadeOut();'>"+message+"</div>");
}
function apply_macro(key){
	if(key){
		$.post(apply_macro_url, { "id": key,"type":"get_macro"},
			function(data){
				eval(data);
				for(var i=0;i<actions.length;i++){
					
					switch (actions[i].key){
						case "public":
							if(actions[i].value == 1) $("#TicketForm_"+actions[i].key).attr("checked","checked");
							else $("#TicketForm_"+actions[i].key).removeAttr("checked");
							continue;
							break;
						case "group_id":
							$("#TicketForm_"+actions[i].key).val(actions[i].value);
							$("#TicketForm_"+actions[i].key).change();
							break;
						case "assignee_id":
							postvalues.assignee_id = actions[i].value;
						  	break;
						case "content":
							ueditor.setContent(actions[i].value,true);	// ueditor赋值
							// var content =
							// $("#TicketForm_"+actions[i].key).val();
							// $("#TicketForm_"+actions[i].key).val(content+actions[i].value);
							break;
						case "tags":
							$("#TicketForm_tag").val("");	// 清空tag输入框
							var tags = new Array();
							tags = actions[i].value.split(",");
							for (var g=0;g<tags.length ;g++ ){    
								add_tag(tags[g]);
						    }
							break;
						default:
							$("#TicketForm_"+actions[i].key).val(actions[i].value);
					}
					// 不能给editor设置样式
					if(actions[i].key=='content') continue;
					
					$("#TicketForm_"+actions[i].key).attr("style","color: green");
				}
				cascade_macro();	// 级联字段js
				$("#macro_items").hide("fast");
		});
	}
}
function update_assignee_id(){
	if(typeof(postvalues) != "undefined" && $("#TicketForm_assignee_id").val() != postvalues.assignee_id){
		setTimeout(function(){
			$("#TicketForm_assignee_id").val(postvalues.assignee_id);
		},500);
	}
};


/**
 * AJAX预览图片
 * 
 * @param int
 *            id 图片附件的id
 */
var attachment_preview_requesting=false;
function attachment_preview(img_id){
    if(!attachment_preview_requesting){
        attachment_preview_requesting=true;
        var xw=900,
            xl=500,
            width = 0,
            height = 0,
            bili,a, b,
            previewEl;
        $.getJSON("/attachments/ajax",{id:img_id},function(data){
            attachment_preview_requesting=false;
            if(data){
                bili = data.width/data.height;
                a = xw/data.width;
                b = xl/data.height;
                if(a<1 || b<1){
                    if(a<=b){
                        width=xw;
                        height=xw/bili;
                    }else{
                        width=xl*bili;
                        height=xl;
                    }
                }else{
                    width = data.width;
                    height = data.height;
                }
                previewEl=$('<div class="light-box-mask">\
                        <div class="light-box" style="max-width:none;">\
                            <header>\
                                <a class="close" href="javascript:void(0);" onclick="$(this).parent().parent().parent().remove();"><i class="icon-cross"></i></a>\
                                <h3>预览</h3>\
                            </header>\
                            <div class="light-box-body light-box-alertbody" style="padding-bottom:5px; text-align:center;"><img src="'+data.src+'" width="'+width+'" height="'+height+'" /></div>\
                        </div>\
                    </div>');
                previewEl.appendTo('body');
            }else{
                KF5.alert("预览失败！图片不存在或者已被删除.");
            }
        }).fail(function(){
            attachment_preview_requesting=false;
            KF5.alert("预览失败！图片不存在或者已被删除.");
        });
    }
}
var Kf5_PopLayer = {};
Kf5_PopLayer.render = function(selector,title){
	var dom = $(selector);
	dom.addClass("popup-layer");
	dom.wrapInner('<div class="popup-scrim"><div class="popup-inner"><div class="popup-wrapper"></div></div></div>');
	dom.prepend('<div class="popup-overlay"></div>');
	$(".popup-scrim").prepend('<a class="popup-close layer_close"></a>');
	$(selector+" .popup-inner").prepend('<div class="popup-title">'+title+'</div>');
	
	$(".popup-scrim").draggable({
		handle: '.popup-title', 
		cursor: 'move'
	});
	$(selector+" .popup-close").click(function(){
		$(selector).hide();
	});
};